import React from 'react';
export default function Privacy() {
  return <div className="max-w-2xl mx-auto py-20 text-center">
    <h1 className="text-3xl font-bold mb-4">Privacy Policy</h1>
    <p className="text-gray-600 mb-4">We value your privacy. Your data is safe and never sold to third parties.</p>
    <ul className="text-left mx-auto max-w-md text-gray-700 dark:text-gray-300">
      <li className="mb-2">• We use your data only to improve your experience</li>
      <li className="mb-2">• You can request data deletion at any time</li>
      <li className="mb-2">• Cookies are used for analytics and login</li>
    </ul>
  </div>;
}
